import React from "react";
import Navbar from './Navbar';

function Header() {
    return (
        <div className="flex flex-row items-center pb-8 border-b border-x-slate-50">
            <h1>My MERN App</h1>
            <Navbar />
        </div>
    )
};

export default Header;
